INSERT INTO `tbl_email_templates` (`id`, `title`, `slug`, `subject`, `content`, `sender_email`, `isActive`) VALUES (1,'Forgot Password','','Password Recovery','<p>This is an automated e-mail. Please do not reply to this message</p>\n\n<p>Dear Customer,</p>\n\n<p>Seems like you have forgotten your password. Below is your current password. For safety reason, we recommend you to keep changing your password every 3 months and immediately after you recieve this email.</p>\n\n<p><strong>Username :&nbsp;</strong>#username#</p>\n\n<p><strong>Password :&nbsp;</strong>#password#</p>\n\n<p>Thank You!</p>\n\n<p>FrumCare Support</p>\n','info@frumcare.com',1),(3,'Upgrade Pacakge','upgrade-package','Thanks, for upgrading your package','<p>Hi {username},</p>\r\n\r\n<p>You have upgraded your membership from free to {package_name} package.</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>FRUMCARE TEAM,</p>\r\n\r\n<p>This message is autogenerated from frumcare.com website</p>\r\n\r\n<p>&nbsp;</p>\r\n','',1),(4,'Send Invoice','send-invoice','Here is your Invoice Number','<p>Hi {username},</p>\r\n\r\n<p>Thanks for upgrading your package. Below here are the payment details:</p>\r\n\r\n<p>Invoice Number: {invoice_number}</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>FRUMCARE TEAM</p>\r\n\r\n<p>This message is auto generated by frumcare.com</p>\r\n','',1),(5,'Send Invoice Remainder','send-invoice-remainder','Here is your Invoice Remainder','<p>Hi {username},</p>\r\n\r\n<p>Here is the invoice remainder.&nbsp;</p>\r\n\r\n<p>Invoice Number: {invoice_number}</p>\r\n\r\n<p>Thanks,</p>\r\n\r\n<p>The Frumcare Team</p>\r\n\r\n<p>This message is automatically generated from frumcare.com website</p>\r\n\r\n<p>&nbsp;</p>\r\n','',1);
