INSERT INTO `tbl_pages` (`id`, `title`, `seo_meta_title`, `seo_meta_keywords`, `seo_meta_description`, `content`, `parent_id`, `isPublished`, `sort_order`, `slug`) VALUES (1,'Terms and Conditions','terms and conditions, FrumCare','terms and conditions, FrumCare','terms and conditions, FrumCare','<p>Lorem ipsum dolor sit amet, sanctus recteque moderatius ea pro. Agam ullamcorper ne cum, quot solet appareat te nam. An quod posse disputationi mei, cum vivendo consectetuer te, laboramus prodesset his ei. Ius pertinax mnesarchum ad.</p>\r\n\r\n<p>Ne nostrud disputationi delicatissimi pri, scripta oblique praesent nec id. Sit ad populo contentiones, etiam posidonium eos at. Est stet constituam consectetuer ut. Ex pro omittam percipit hendrerit. Feugiat corpora definiebas te usu, id nam eirmod legimus. Verterem menandri dignissim an vis, nam no quas cetero cotidieque. Phaedrum suscipiantur definitiones cu eos, te usu sonet scaevola gloriatur.</p>\r\n\r\n<p>Mei splendide mediocritatem id. Exerci assueverit per id, sed ex ceteros praesent. Ad timeam corrumpit nec, est esse alienum ei, iisque mediocrem cu sit. Usu legendos dignissim honestatis eu, sea laudem soleat conclusionemque ad. Vim sanctus delenit in. Fabulas omnesque ex eam, cu populo nostro docendi vel, no nam ullum dicam tractatos.</p>\r\n','',1,0,'terms-and-conditions'),(2,'Our Privacy Policy','Privacy Policy','Privacy Policy','Privacy Policy','<h3>1. GENERAL PRINCIPLES</h3>\r\n\r\n<p>Protecting your privacy is very important to us. We have accordingly developed this Privacy Policy to protect your personal information and keep it confidential. We endeavour to comply with laws of other countries but cannot and do not warrant that we do. We do everything we reasonably can to protect your rights of privacy on systems and the Website controlled by us, but we are not liable for any unauthorised or unlawful disclosures of your personal and confidential information made by third parties who are not subject to our control, for example advertisers and websites that have links to our Website. You should take note that the information and privacy practices of our business partners, advertisers, sponsors or other sites to which we provide hyperlinks, may be different from ours. Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.</p>\r\n\r\n<p><strong>We categorise information about you (collectively referred to as &quot;Personal Information&quot;) as follows:</strong></p>\r\n\r\n<p><strong>(a) Profiling Information:</strong>&nbsp;Information which you provide when you register for a Service, which may include some or all of the following: - Information about your personal identity such as gender, marital status, age, preferences, likes and dislikes etc.; - Your financial information such as your banking details and any information relating to your income and lifestyle levels; and - Your contact details such as your physical addresses, postal addresses, telephone and fax numbers and the like. - In the case of Facebook aligned services (if so opted by you), publicly available information of your friends, their likes and dislikes, etc.&nbsp;<strong>(b) Payment and Account Information:</strong>&nbsp;Your account history with us including (without limitation) all billing information and communications, payment history etc. We maintain this in encrypted form on secure servers.<strong>(c) Service Usage:</strong>&nbsp;Information about your navigation using our Services, for example the URLs of websites, which you visit and from which you request downloads.&nbsp;<strong>(d) Log information:</strong>Information such as your web request, IP address, browser type, browser language, date and time of request.&nbsp;<strong>(e) Transactional Information:</strong>&nbsp;Transactional history (other than banking details) about your e-commerce activities.&nbsp;<strong>(f) Correspondence Information:</strong>&nbsp;Content, information about your correspondents, and the destination/origin of communications between you and any other person using our Services, which include email communications, blog, chat room and discussion board communications, instant message communications, experts forum communications, faxmail communications, membership of mailing lists etc.&nbsp;<strong>(g) User IDs:</strong>&nbsp;Your usernames, passwords, email addresses and other security-related information used by you in relation to our Services.&nbsp;<strong>(h) Stored Information:</strong>&nbsp;Data either created by you or by a third party and which you wish to store on our servers such as image files, documents etc.&nbsp;<strong>We only collect your Personal Information to conduct our business and to enable us to deliver and improve our Services. We do not for any reason whatsoever sell your Personal Information to any third party or otherwise trade on it.</strong></p>\r\n\r\n<p>We will only disclose your Personal Information in accordance with this Privacy Policy. If we want to use it for any other purpose, we will obtain your prior written consent. If you decline to submit personal information to us, then we will unfortunately not be in a position to provide the Services to you. Any of your information which you provide when you use certain Services and are to an open, public environment or forum including (without limitation) any blog, community or discussion board, is not confidential, does not constitute Personal Information, and is not subject to protection under Privacy Policy. Since such public environments are accessible by third parties, it is possible that third parties may collect and collate and use such information for their own purposes. You should accordingly be careful when deciding to share any of your Personal Information in such public environments. Information, which is disclosed publicly, is also shared with our affiliates, third party service providers, sponsors of competitions etc. unless expressly stated otherwise. We are not liable to you or any third party for any damages that you or any third party may suffer howsoever arising from your disclosure of Personal Information in any public environment. You accordingly disclose information in a public environment at your own risk.</p>\r\n','about',1,0,'our-privacy-policy'),(3,'About Us','FrumCare, About FrumCare','FrumCare, About FrumCare','FrumCare, About FrumCare','<p><strong>About Us</strong></p>\n\n<p>At FrumCare, we understand how hard it can be to find quality caregivers who understand the unique needs of your Orthodox Jewish household or institution.FrumCare was created to help families and caregivers in global religious Jewish communities find each other in a safeand trustworthy manner. We specialize in finding care workers who are frum-friendly and sensitive to the intricacies of keeping kosher, the laws and restrictions governing the Sabbath/Holidays, and the issues surrounding modest comportment.</p>\n\n<p>FrumCare helps families find local child care, senior care, special needs care, day camps, tutors, and household or cleaning help. FrumCaremakes connections between the Orthodox Jewish community and observant physical and mental health professionals, as well asinstitutions servicing these areas.For caregivers and caregiving institutions, FrumCare provides a unique opportunity to advertise your services locally and abroad.</p>\n\n<p>Bringing together the latest technologiesand our vast experience in the field, our site is closely monitored to ensure safety and reliability. Our listed caregivers provide detailed information, allowingfrum parents to feel confident in hiring them.</p>\n\n<p>Whether you are looking for a babysitter, live-innanny, household help, someone to pick up your children from school, homework help, arecommendedhealthcare provider, and much more,FrumCare assists you in finding the right match for your needs.</p>\n','0',1,0,'about-us'),(4,'Help','FrumCare, Help FrumCare','FrumCare, Help FrumCare','FrumCare, Help FrumCare','<p>Lorem ipsum dolor sit amet, propriae accusata duo id, ius cu primis consequat efficiantur. Nam id graeco perfecto, vitae nonumy mei te. Ius ad hinc verterem imperdiet. Constituam omittantur an vis. Mel audiam labitur et, an utinam doctus eam. Sed graeco repudiandae et. Harum facete vivendum ne mei, prima incorrupte ei sit.</p>\r\n\r\n<p>Viris phaedrum mediocritatem id eos, ex sea homero aliquip, no vide omnes moderatius sea. Liber exerci fierent te usu, ex altera constituam nec, nec no assum consequat mediocritatem. Ei timeam molestie vel. Ne iusto deleniti antiopam ius, assum conclusionemque ei pro. Quidam tacimates has in, omnes urbanitas te vel, amet expetenda quo an. Vidit platonem an mea, meis consul sea no, ad percipit consulatu est.</p>\r\n\r\n<p>Ei porro timeam recteque qui, rebum explicari quo an. Probatus antiopam intellegat eu mea, ei postea molestiae ius. Id mei doming viderer, eu pro agam utroque, ne usu quod scripta labitur. Putent constituto voluptatum te sea. Pro malis deleniti cu, per postea laoreet adversarium an, te ullum accusata inimicus eos. Eos oblique theophrastus et.</p>\r\n','',1,0,'help'),(5,'Press Releases','Press Release','Press Release','Press Release Wefne','<p>Protecting your privacy is very important to us. We have accordingly developed this Privacy Policy to protect your personal information and keep it confidential. We endeavour to comply with laws of other countries but cannot and do not warrant that we do. We do everything we reasonably can to protect your rights of privacy on systems and the Website controlled by us, but we are not liable for any unauthorised or unlawful disclosures of your personal and confidential information made by third parties who are not subject to our control, for example advertisers and websites that have links to our Website. You should take note that the information and privacy practices of our business partners, advertisers, sponsors or other sites to which we provide hyperlinks, may be different from ours. Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.</p>\n\n<p><strong>We categorise information about you (collectively referred to as &quot;Personal Information&quot;) as follows:</strong></p>\n\n<p><strong>(a) Profiling Information:</strong>&nbsp;Information which you provide when you register for a Service, which may include some or all of the following: - Information about your personal identity such as gender, marital status, age, preferences, likes and dislikes etc.; - Your financial information such as your banking details and any information relating to your income and lifestyle levels; and - Your contact details such as your physical addresses, postal addresses, telephone and fax numbers and the like. - In the case of Facebook aligned services (if so opted by you), publicly available information of your friends, their likes and dislikes, etc.&nbsp;<strong>(b) Payment and Account Information:</strong>&nbsp;Your account history with us including (without limitation) all billing information and communications, payment history etc. We maintain this in encrypted form on secure servers.<strong>(c) Service Usage:</strong>&nbsp;Information about your navigation using our Services, for example the URLs of websites, which you visit and from which you request downloads.&nbsp;<strong>(d) Log information:</strong>Information such as your web request, IP address, browser type, browser language, date and time of request.&nbsp;<strong>(e) Transactional Information:</strong>&nbsp;Transactional history (other than banking details) about your e-commerce activities.&nbsp;<strong>(f) Correspondence Information:</strong>&nbsp;Content, information about your correspondents, and the destination/origin of communications between you and any other person using our Services, which include email communications, blog, chat room and discussion board communications, instant message communications, experts forum communications, faxmail communications, membership of mailing lists etc.&nbsp;<strong>(g) User IDs:</strong>&nbsp;Your usernames, passwords, email addresses and other security-related information used by you in relation to our Services.&nbsp;<strong>(h) Stored Information:</strong>&nbsp;Data either created by you or by a third party and which you wish to store on our servers such as image files, documents etc.&nbsp;<strong>We only collect your Personal Information to conduct our business and to enable us to deliver and improve our Services. We do not for any reason whatsoever sell your Personal Information to any third party or otherwise trade on it.</strong></p>\n\n<p>We will only disclose your Personal Information in accordance with this Privacy Policy. If we want to use it for any other purpose, we will obtain your prior written consent. If you decline to submit personal information to us, then we will unfortunately not be in a position to provide the Services to you. Any of your information which you provide when you use certain Services and are to an open, public environment or forum including (without limitation) any blog, community or discussion board, is not confidential, does not constitute Personal Information, and is not subject to protection under Privacy Policy. Since such public environments are accessible by third parties, it is possible that third parties may collect and collate and use such information for their own purposes. You should accordingly be careful when deciding to share any of your Personal Information in such public environments. Information, which is disclosed publicly, is also shared with our affiliates, third party service providers, sponsors of competitions etc. unless expressly stated otherwise. We are not liable to you or any third party for any damages that you or any third party may suffer howsoever arising from your disclosure of Personal Information in any public environment. You accordingly disclose information in a public environment at your own risk.</p>\n','0',1,0,'press-releases'),(6,'Frequently Asked Questions','Faqs','Faqs','Faqs','<p><strong>WEBSITE</strong></p>\r\n\r\n<p><strong>How do I determine the correct size for me?</strong></p>\r\n\r\n<p>You can view the sizing details for a product by clicking on the &#39;Not sure about your size?&#39; link on the product page located above the &#39;Buy Now&#39; button. This displays the size chart for the product and helps you decide which size fits you best.&nbsp;You can always return the product if the size you selected does not fit you properly.&nbsp;</p>\r\n\r\n<p><strong>What can I do if the product is not available in my size?</strong></p>\r\n\r\n<p>If a product is not available in your size, you can choose to be notified when it comes back in stock. To create a notification, please go to the product details page, choose your size, and provide your email address in the text box below the size display. We&#39;ll send you an email as soon as the item is back in stock. Please note that sometimes we may not be able to procure the item in your size. In such cases you will not receive a notification from us.</p>\r\n\r\n<p><strong>How long does it take for an order to be delivered to me?</strong></p>\r\n\r\n<p>We deliver most of our orders within 7 days from the order date. You can find out how long we will need to deliver your order to your specific pincode using the courier serviceability tool located on the right side on all product detail pages.</p>\r\n\r\n<p><strong>How are orders on Wefne.com delivered to me?</strong></p>\r\n\r\n<p>All orders placed on Wefne.com are dispatched through our own courier service - Wefne.com Logistics, or through other courier partners such as Blue Dart, Quantium, etc. We do not use Speed Post to deliver orders placed on Myntra.com</p>\r\n\r\n<p><strong>Does Wefne.com deliver products outside Nepal?</strong></p>\r\n\r\n<p>No. At this point, Wefne.com delivers products only within Nepal.</p>\r\n\r\n<h3><strong>COUPONS AND CASHBACK</strong></h3>\r\n\r\n<p><strong>How do I apply a coupon?</strong></p>\r\n\r\n<p>You can apply a coupon on cart page before you place an order. The complete list of your unused and valid coupons is available under the &#39;Wefne&nbsp;Credits&#39; header in your &#39;My Wefne&#39; section.</p>\r\n\r\n<p><strong>What is cashback? How do I redeem it?</strong></p>\r\n\r\n<p>Cashback is your store credit with Wefne.com that can be used to pay for purchases on Wefne.com. You get cashback when you return items to Wefne.com or when you receive Wefne.com Gift Cards. You can redeem your cashback on the Payments page.</p>\r\n\r\n<p>You can check your cashback balance in your &#39;My Wefne&#39; section.</p>\r\n\r\n<h3><strong>PAYMENTS</strong></h3>\r\n\r\n<p><strong>How can I pay for my order at Wefne.com?</strong></p>\r\n\r\n<p><strong>How does the COD (Cash on Delivery) payment option work?</strong></p>\r\n\r\n<p>Cash on Delivery allows you to pay for your order with cash at the time of delivery. Myntra.com offers a Cash on Delivery option for all orders between Rs. 299 and Rs. 20000 for most delivery addresses. To place an order and pay for it using Cash on Delivery (COD), please select the &#39;Cash On Delivery&#39; option on the payment page.</p>\r\n\r\n<p><strong>Why can&#39;t I see the COD option on my payment page?</strong></p>\r\n\r\n<p>If you do not see a COD option on your payment page, this may be due to one of the following reasons:</p>\r\n\r\n<ol>\r\n	<li>Your order value may be below Rs. 299 or over Rs. 20000.</li>\r\n	<li>Our courier partners may not support a Cash on Delivery option to your delivery address.</li>\r\n	<li>You may have placed another order using the COD option which is pending delivery. If the amount of this order when added to your current order exceeds Rs. 20000, then the COD option will be disabled.</li>\r\n</ol>\r\n\r\n<p><strong>What should I do if my payment fails?</strong></p>\r\n\r\n<p>Please retry making the payment after ensuring that the information entered is accurate, including all account details, billing addresses and passwords. If your payment still fails, you can use the Cash on Delivery(COD) payment option on the payment page to place your order.</p>\r\n\r\n<p>If your payment is debited from your account after a payment failure, it will be credited back within 7-10 business days, after we receive a confirmation from the bank.</p>\r\n\r\n<p><strong>I am being charged a VAT amount on my order. What is VAT?</strong></p>\r\n\r\n<p>Value Added Tax (VAT) is an indirect tax under the Nepali taxation system which is levied, based on consumption, by state governments. VAT will have to borne/paid by the ultimate consumer of the product.</p>\r\n\r\n<p><strong>How is the VAT amount decided?</strong></p>\r\n\r\n<p>Following rules will govern whether or not an additional VAT will be applicable on the products purchased by you:</p>\r\n\r\n<ol>\r\n	<li>Products which are sold at a net discount of 19% or above, VAT is not included in the price and an additional VAT will be collected over and above the discounted price.</li>\r\n	<li>Products which are sold at Maximum Retail Price or at a net discount less than 19%, VAT is included in the price and no additional VAT will be charged.Net discount is essentially the product price less of product discount and coupon discount, if any.</li>\r\n</ol>\r\n\r\n<p>Max 9% VAT on Footwear and max 5% VAT on other categories is applicable. Note: In case the product ordered in an apparel, then actual VAT (which is a maxiumum of 5% currently) will be charged and for non-apparel products a maximum VAT of 9% may be collected from you and remaining will be funded by Myntra.</p>\r\n\r\n<p><strong>If I return the purchased product will the VAT amount charged be refunded?</strong></p>\r\n\r\n<p>Yes. If you return the product the applicable VAT amount will also be refunded to your Myntra cashback account.</p>\r\n\r\n<p><strong>If I cancel my order will the VAT amount charged be refunded?</strong></p>\r\n\r\n<p>Yes. If you cancel the order, the applicable VAT amount will also be refunded to your Myntra cashback account.</p>\r\n','help',1,0,'faqs'),(9,'Cancellation','Cancellation','Cancellation','Cancellation','<p>Cancel or&nbsp;<strong>cancellation</strong>&nbsp;may refer to: Business.&nbsp;<strong>Cancellation</strong>&nbsp;(mail), a postal marking applied to a stamp or stationery indicating the item has been used&nbsp;&nbsp;<strong>...</strong>Cancel or&nbsp;<strong>cancellation</strong>&nbsp;may refer to: Business.&nbsp;<strong>Cancellation</strong>&nbsp;(mail), a postal marking applied to a stamp or stationery indicating the item has been used&nbsp;&nbsp;<strong>...</strong>Cancel or&nbsp;<strong>cancellation</strong>&nbsp;may refer to: Business.&nbsp;<strong>Cancellation</strong>&nbsp;(mail), a postal marking applied to a stamp or stationery indicating the item has been used&nbsp;&nbsp;<strong>...</strong>Cancel or&nbsp;<strong>cancellation</strong>&nbsp;may refer to: Business.&nbsp;<strong>Cancellation</strong>&nbsp;(mail), a postal marking applied to a stamp or stationery indicating the item has been used&nbsp;&nbsp;<strong>...</strong>Cancel or&nbsp;<strong>cancellation</strong>&nbsp;may refer to: Business.&nbsp;<strong>Cancellation</strong>&nbsp;(mail), a postal marking applied to a stamp or stationery indicating the item has been used&nbsp;&nbsp;<strong>...</strong>Cancel or&nbsp;<strong>cancellation</strong>&nbsp;may refer to: Business.&nbsp;<strong>Cancellation</strong>&nbsp;(mail), a postal marking applied to a stamp or stationery indicating the item has been used&nbsp;&nbsp;<strong>...</strong></p>\n','0',1,0,'cancellation'),(10,'Staying Safe','Staying Safe','Staying Safe , Staying, Safe','Stay Safe always and every where','<p>Lorem Ipsum&nbsp;is simply dummy text of the printing and typesetting ind